import React from "react";
import { Form } from "antd";

const dummy = {
    isLoggedIn: true,
}

const Home = () => {
  return (
    <>
      {dummy.isLoggedIn && <Form encType="multipart/form-data">
          <Input.TextArea maxLength={140} placeholder=""></Input.TextArea>

      </Form>}
    </>
  );
};

export default Home;
